import React, { useEffect, useState } from 'react';
import axios from 'axios';
 
const Details = () => {
  const [product, setProduct] = useState(null); // State to hold the product data
  const productId = 'PUT_THE_PRODUCT_ID_HERE'; // Replace with the actual product ID
 
  useEffect(() => {
    // Fetch data for a specific product by ID
    axios.get(`http://localhost:5120/api/Product/${productId}`)
      .then((response) => {
        setProduct(response.data); // Update state with product data
      })
      .catch((error) => {
        console.error('Error fetching product details:', error);
      });
  }, [productId]); // Trigger the effect when productId changes (if needed)
 
  return (
<div>
      {/* Render product details once data is fetched */}
      {product ? (
<div>
<h3 className="text-uppercase">{product.title}</h3>
<p>Author: {product.author}</p>
          {/* Render other product details accordingly */}
<p>Description: {product.description}</p>
<p>ISBN: {product.isbn}</p>
<p>Price: {product.price}</p>
          {/* Add more details as needed */}
</div>
      ) : (
<p>Loading...</p>
      )}
</div>
  );
};
 
export default Details;
